import React from 'react';

const Song = ({ currentSong, isPlaying }) => {
  return (
    <div className={`isPlaying $` }>
      <img
        lat={currentSong.name}
        src={currentSong.cover}
        alt="coverArtwork"
      ></img>
      <h2>{currentSong.name}</h2>
      <h3>{currentSong.artist}</h3>
    </div>
  );
};

export default Song;
